//List Rendering

import React ,{Component} from 'react'

function NameList(){

    const names =['Bruce','List','Diana']

    return(
        <div>
             <h1>{names[0]}</h1>
             <h1>{names[1]}</h1>
             <h1>{names[2]}</h1>
        </div>
    )
}

export default NameList
